import React from "react";
import { NavLink } from "react-router-dom";
import Logo from "./assets/logo.png"

export default function Navbar() {
    return (
        <header>
            <nav className="navbar mx-auto px-3">
                <NavLink to="/">
                    <img src={Logo} alt="Logo" />
                </NavLink>
                <ul className='d-md-flex d-none justify-content-between m-0'>
                    <li><NavLink exact activeclassname="active" to="/News">
                        <i className="fa-light fa-person-dress"></i></NavLink></li>
                    <li><NavLink exact activeclassname="active" to="/Videos"><i className="fa-light fa-person"></i></NavLink></li>
                    <li><NavLink exact activeclassname="active" to="/Blog"><i className="fa-light fa-child"></i></NavLink></li>
                </ul>
            </nav>
        </header>
    )
}
